module.exports = class Agent {
    constructor(me, counts, values, max_rounds, log){
        this.counts = counts;
        this.values = values;
        this.rounds = max_rounds;
        this.log = log;
        this.total = 0;
        for (let i = 0; i<counts.length; i++) {
            this.total += counts[i]*values[i];
        }
        let isA = (me == 0);

        let unitStack = UnitStack.fromSetups(setups);

        this.actionizer = new Actionizer(this.values, this.counts, isA, unitStack);
    }
    offer(incomingOffer){
      this.log(`${this.rounds} rounds left`);
      this.rounds--;
      incomingOffer = incomingOffer || [0, 0, 0];

      let sum = 0;
      for (let i = 0; i<incomingOffer.length; i++) {
        sum += this.values[i]*incomingOffer[i];
      }
      if (sum>this.total * (0.75 + Math.random() * 0.1)) {
        return;
      }

      this.actionizer.incomingOffer(incomingOffer);
      let outgoingOffer = this.actionizer.generateBestOffer();

      let isSame = true;

      let outgoingSum = 0;
      for (let i = 0; i<outgoingOffer.length; i++) {
        isSame = isSame && (outgoingOffer[i] == incomingOffer[i]);
        outgoingSum += this.values[i]*outgoingOffer[i];
      }

      if (isSame) {
        return;
      } else if ((outgoingSum < sum) && (sum <= 6)) {
        return;
      } else if ((outgoingSum <= sum) && (sum > 6)) {
        return;
      } else {
        this.actionizer.outgoingOffer(outgoingOffer);
        //console.log('outgoingOffer', outgoingOffer);
        return outgoingOffer;
      }


    }
};
